<script> //launch masonry.
$(function(){
        var $container = $('#container');

          $container.masonry({
           itemSelector: '.box',
           columnwidth: function( containerWidth ) {
            return containerWidth / 10;

           //gutterWidth: 10,
           isAnimated: true,
           animationOptions: {
            duration: 750,
            easing: 'linear',
            queue: false
           } 
          });
        });
       setTimeout (function() { $('#container').masonry ('reload'); }, 500);
});

</script>
